import collectionsclass Solution:    def findPairs(self, nums, k):        """        :type nums: List[int]        :type k: int        :rtype: int        """        if k<0:            return 0        if k!=0:            count=0            nums=set(nums)            for item in nums:                if item-k in nums:                    count+=1            return count        else:            count=0            c=collections.Counter(nums)            for key in c:                if c[key]>1:                    count+=1            return counts=Solution()A = [3,1,4,1,5]k=0print(s.findPairs(A,k))# 如果没有set这一步 time limited error